css:
@-moz-document domain("www.instagram.com") {
.-cx-PRIVATE-Shell__nav { background-color: #2A5B83 !important;border-bottom-color: #414B4C !important;box-shadow: 1px 1px 2px #3B4344 !important;}
.-cx-PRIVATE-SearchBox__inactiveLabel { background: #326FA0 !important;color: #DCDCDC !important;border: solid 1px #326FA0 !important;border-radius: 2px !important;}
.-cx-PRIVATE-SearchBox__input {border-radius: 2px !important;background-color: #326FA0 !important;border: solid 1px #326FA0 !important;}
.-cx-PRIVATE-Post__feed .-cx-PRIVATE-Post__header {background-color: #2F3739 !important;}
a, a:visited {color: #fff !important;}
.-cx-PRIVATE-Shell__content {background-color: #414B4C !important;}
.-cx-PRIVATE-FeedPage__post, .-cx-PRIVATE-FeedPage__suggestedUsersList {border: 1px solid #2F3739 !important;background-color: #2F3739 !important;box-shadow: 1px 1px 2px #3B4344 !important;}
.-cx-PRIVATE-PostInfo__feedback {border-top: none !Important;}
html, body, div, span, applet, object, iframe, h1, h2, h3, h4, h5, h6, p, blockquote, pre, abbr, acronym, address, big, cite, code, del, dfn, em, img, ins, kbd, q, s, samp, small, strike, strong, sub, sup, tt, var, b, u, i, center, dl, dt, dd, ol, ul, li, fieldset, form, label, legend, table, caption, tbody, tfoot, thead, tr, th, td, article, aside, canvas, details, embed, figure, figcaption, footer, header, hgroup, menu, nav, output, ruby, section, summary, time, mark, audio, video {color: #ABABAB !important;}
.-cx-PRIVATE-PostInfo__root, .-cx-PRIVATE-PostInfo__commentCreatorInput, .-cx-PRIVATE-PostInfo__commentsLoadMoreButton {color: #ABABAB !important;}
.-cx-PRIVATE-Post__feed .-cx-PRIVATE-Post__media {border-top: none !important; border-bottom: none !important;}
.-cx-PRIVATE-Shell__footer { background-color: #2F3739 !Important;}
.-cx-PRIVATE-Search__root {background: #4D5758 !important;border: solid 1px #4D5758 !important;}
.-cx-PRIVATE-Search__selected {background: #414B4C !important;}
.-cx-PRIVATE-Search__result {border-bottom: none !important;}
}
